import React, { createContext } from 'react'
import App from '../App';

const storetoken=createContext();

const Apicontext = (Token) => {
    const tokenstoreftn=(Token)=>{
        localStorage.setItem('token',Token)
    }
  return (
    <>
      <storetoken.Provider storingtoken={tokenstoreftn}>
        <App/>
      </storetoken.Provider>
    </>
  )
}

export {Apicontext,storetoken}
